import React from 'react';
import { BrowserRouter as Router, Route, Link } from 'react-router-dom';
import Users from '../Pages/Users/UsersCRUD.jsx';
/*import Peliculas from './Peliculas';
import Rentas from './Rentas';*/

function BarraSuperior() {
  return (
    <nav>
      <ul>
        <li><Link to="/usuarios">Usuarios</Link></li>
        <li><Link to="/peliculas">Pel√≠culas</Link></li>
        <li><Link to="/rentas">Rentas</Link></li>
      </ul>
    </nav>
  );
}

function PaginaInicial() {
  return (
    <div>
      <BarraSuperior />
      <img src="./imagen.png" alt="Imagen" />
    </div>
  );
}

function Root() {
  return (
    <Router>
      <Route exact path="/" component={PaginaInicial} />
      <Route path="/usuarios" component={Users} />
      {/*<Route path="/peliculas" component={Peliculas} />
    <Route path="/rentas" component={Rentas} />*/}
    </Router>
  );
}

export default Root;
